  false,\n\t\"url\": null,\n\t\"notes\": \"Amphibians, reptiles, birds, and mammals
  were surveyed at six created forested wetlands in central Maryland and at six adjacent
  reference forested wetlands during 1993-1996 to determine comparative biological
  diversity of these habitats. Amphibians and reptiles were caught in pitfall and
  funnel traps associated with 15.4 m (50-ft) drift fences. Birds were surveyed with
  a complete count while walking through each area. Mammals were  surveyed by capture
  in live traps. More species and total individuals of amphibians were caught on the
  reference wetlands than on the created wetlands. Although species richness and total
  number of animals were high for created forested wetlands, these survey results
  show major differences from species expected for a forested wetland. The created
  forested wetlands appear to provide good habitat for wildlife, but are probably
  not providing the full functions and values of the forested wetlands that they were
  constructed to replace.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
